import React from "react";
import { useParams } from "react-router-dom";

const EventsDetailPage = () => {
  const params = useParams();
  return (
    <>
      <h1>EventsDetail</h1>
      <p>Event ID : {params.eventsID}</p>
    </>
  );
};

export default EventsDetailPage;
